(3,1,'pdf-url','pdf url','1754936518_blog2.png','https://ontheline.trincoll.edu/images/bookdown/sample-local-pdf.pdf','pdf_url','<h1><a href=\"https://make.wordpress.org/themes/2016/03/31/what-is-demo-content/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); color: inherit;\">What is demo content?</a></h1><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(30, 30, 30);\">When a user activates a theme, they have an expectation of seeing their photos, theirs shop, their contributors and all of their content with a new style or twist. Themes provide this ability to showcase user content in different ways. How a theme gets that content is what we look for. When there is no content a theme should not show anything. This has been an issue in </span><u style=\"background-color: rgb(255, 255, 255); color: rgb(56, 88, 233);\"><a href=\"https://make.wordpress.org/themes/2015/05/27/front-page-demo-content/\" rel=\"noopener noreferrer\" target=\"_blank\">the past</a></u><span style=\"background-color: rgb(255, 255, 255); color: rgb(30, 30, 30);\"> and this will hopefully add more information to that. Sounds simple, right?</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(30, 30, 30);\">Yes and no.</span></p><h3><span style=\"background-color: rgb(255, 255, 255); color: rgb(30, 30, 30);\">What about default settings?</span></h3><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(30, 30, 30);\">Brilliant question to ask because themes need to have a basic, or default, setting in order to display user content. Let’s look at a good example of this. Using a basic </span><span style=\"background-color: rgb(246, 246, 246); color: rgb(30, 30, 30);\">loop</span><span style=\"background-color: rgb(255, 255, 255); color: rgb(30, 30, 30);\"> as an example:</span></p><p>Sample PDF Created for testing PDFObject This PDF is three pages long. Three long pages. Or three short pages if you’re optim